            border-radius: 8px;
            width: 110px;
            height: 40px;
            color: #fff;
            text-align: center;
            font-weight: 500;
            font-size: 14px;
            background-color: #0E4498;
            bottom: 30px;
            right: 30px;
        }
        `}</style>
          </body>
        </Html>
      )
    }
  }
  
  export default MyDocument
